import React, { Component } from 'react';

class InputTodo extends Component {
    state = {
        title: ''
    }

    onChange = e => {
    this.setState({
        [e.target.name]: e.target.value
    });
    };

    render() { 
        return (
            <form>
                <input type='text' placeholder='What to do?' value={this.state.title} onChange = {this.onChange} name ='title'/>
                <input type='text' placeholder='What to do?' value={this.state.title} onChange = {this.onChange} name ='parrar'/>
                <button>Submit</button>
            </form>
        );
    }
}
 
export default InputTodo;
